import React from "react";
import add,{sub,mul,div} from './Calculation';

function App() {
     
    return (
        <>
            <ol>
                <li>{sub(2,3)}</li>
                <li>{mul(2,3)}</li>
                <li>{div(2,3)}</li>
                <li>{add(2,3)}</li>
            </ol>
        </>
    );
}
export default App;
